ight: normal; font-family: &#39;Helvetica Neue&#39;;\">（如需加工烧烤一下请在备注里说明）</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">猪蹄<span style=\"font-size: 13px; line-height: normal;\">，</span>是指猪的脚部<span style=\"font-size: 13px; line-height: normal;\">（</span>蹄<span style=\"font-size: 13px; line-height: normal;\">）</span>和小腿<span style=\"font-size: 13px; line-height: normal;\">，</span>在中国又叫元蹄。在华人世界中<span style=\"font-size: 13px; line-height: normal;\">，</span>猪蹄是猪常被人食用的部位之一<span style=\"font-size: 13px; line-height: normal;\">，</span>有多种不同的烹调作法。猪蹄含有丰富的胶原蛋白质<span style=\"font-size: 13px; line-height: normal;\">，</span>脂肪含量也比肥肉低。它能防治皮肤干瘪起皱、增强皮肤弹性和韧性<span style=\"font-size: 13px; line-height: normal;\">，</span>对延缓衰老和促进儿童生长发育都具有特殊意义。为此<span style=\"font-size: 13px; line-height: normal;\">，</span>人们把猪蹄称为<span style=\"font-size: 13px; line-height: normal;\">“</span>美容食品<span style=\"font-size: 13px; line-height: normal;\">” </span>和<span style=\"font-size: 13px; line-height: normal;\">“</span>类似于熊掌的美味佳肴</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">营养成分</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 13px; line-height: normal; font-family: &#39;Helvetica Neue&#39;; min-height: 15px;\"><span style=\"font-size: 14px;\">猪蹄中含有较多的蛋白质、脂肪和碳水化合物</span><span style=\"line-height: normal;\">，</span><span style=\"font-size: 14px;\">并含有钙、磷、镁、铁以及维生素</span><span style=\"line-height: normal;\">A</span><span style=\"font-size: 14px;\">、维生素</span><span style=\"line-height: normal;\">D</span><span style=\"font-size: 14px;\">、维生素</span><span style=\"line-height: normal;\">E</span><span style=\"font-size: 14px;\">、维生素</span><span style=\"line-height: normal;\">K</span><span style=\"font-size: 14px;\">等有益成分</span><br/></p><p><img src=\"/vshop/data/attached/image/20180119/1516355208465938.jpg\" style=\"\" title=\"1516355208465938.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180119/1516355208479048.jpg\" style=\"\" title=\"1516355208479048.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180119/1516355208126792.jpg\" style=\"\" title=\"1516355208126792.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180119/1516355209100160.jpg\" style=\"\" title=\"1516355209100160.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180119/1516355209749400.jpg\" style=\"\" title=\"1516355209749400.jpg\"/></p><p><br/></p>','images/201801/thumb_img/239_thumb_G_1516326887508.jpg','images/201801/goods_img/239_G_1516326887164.jpg','images/201801/source_img/239_G_1516326887437.jpg',1,'',1,1,0,0,1516326011,3,0,1,1,1,0,0,1516327042,0,'',-1,-1,0,NULL),(57,25,'ECS000057','大黄鱼 500g','+',16,0,'',10000,0.000,17.00,13.98,0.00,0,0,1,'','','<p><img src=\"/vshop/data/attached/image/20170617/1497665369843697.jpg\" title=\"1497665369843697.jpg\"/><img src=\"/vshop/data/attached/image/20170617/1497665369228351.jpg\" style=\"\" title=\"1497665369228351.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20170617/1497665369907591.jpg\" style=\"\" title=\"1497665369907591.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20170617/1497665369768887.jpg\" style=\"\" title=\"1497665369768887.jpg\"/></p><p><br/></p>','images/201706/thumb_img/57_thumb_G_1497636527240.jpg','images/201706/goods_img/57_G_1497636527651.jpg','images/201706/source_img/57_G_1497636527963.jpg',1,'',1,1,0,0,1497636527,100,0,1,0,0,0,0,1502920550,0,'',-1,-1,0,NULL),(58,26,'ECS000058','小嘴鱼 500g','+',21,0,'',10000,0.000,10.00,8.98,0.00,0,0,1,'','','<p><img src=\"/vshop/data/attached/image/20170617/1497665880189863.jpg\" style=\"\" title=\"1497665880189863.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20170617/1497665880667565.jpg\" style=\"\" title=\"1497665880667565.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20170617/1497665880803917.jpg\" style=\"\" title=\"1497665880803917.jpg\"/></p><p><img src=\"/vshop/data/attached/im