/p><p><img src=\"/vshop/data/attached/image/20171221/1513837959688097.jpg\" style=\"\" title=\"1513837959688097.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513837959883613.jpg\" style=\"\" title=\"1513837959883613.jpg\"/></p><p><br/></p>','images/201801/thumb_img/224_thumb_G_1515626746456.jpg','images/201801/goods_img/224_G_1515626746251.jpg','images/201801/source_img/224_G_1515626746507.jpg',1,'',1,1,0,0,1513809103,1,0,1,1,1,0,0,1516748353,0,'',-1,-1,0,NULL),(225,241,'ECS000225','大连野生鲍鱼10个头8只','+',15,0,'',10000,0.000,100.00,68.88,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">鲍鱼是名贵的<span style=\"font-size: 13px; line-height: normal;\">“</span>海珍品<span style=\"font-size: 13px; line-height: normal;\">”</span>之一<span style=\"font-size: 13px; line-height: normal;\">，</span>味道鲜美<span style=\"font-size: 13px; line-height: normal;\">，</span>营养丰富<span style=\"font-size: 13px; line-height: normal;\">，</span>被誉为海洋<span style=\"font-size: 13px; line-height: normal;\">“</span>软黄金<span style=\"font-size: 13px; line-height: normal;\">”</span>。鲍鱼是名贵的海洋食用贝类<span style=\"font-size: 13px; line-height: normal;\">，</span>被誉为<span style=\"font-size: 13px; line-height: normal;\">“</span>餐桌黄金<span style=\"font-size: 13px; line-height: normal;\">，</span>海珍之冠<span style=\"font-size: 13px; line-height: normal;\">”，</span>其肉质细嫩、营养丰富。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">鲜品可食部分蛋白质<span style=\"font-size: 13px; line-height: normal;\">24%</span>、脂肪<span style=\"font-size: 13px; line-height: normal;\">0.44%;</span>干品含蛋白质<span style=\"font-size: 13px; line-height: normal;\">40%</span>、糖元<span style=\"font-size: 13px; line-height: normal;\">33.7%</span>、脂肪<span style=\"font-size: 13px; line-height: normal;\">0.9%</span>以及多种维生素和微量元素<span style=\"font-size: 13px; line-height: normal;\">，</span>足一种对人体非常有利的高蛋白、低脂肪食物。鲍鱼因富含谷氨酸<span style=\"font-size: 13px; line-height: normal;\">，</span>味道非常鲜美。</p><p><img src=\"/vshop/data/attached/image/20171221/1513838564348187.jpg\" style=\"\" title=\"1513838564348187.jpg\"/><br/></p><p><img src=\"/vshop/data/attached/image/20171221/1513838564771151.jpg\" style=\"\" title=\"1513838564771151.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513838564147256.jpg\" style=\"\" title=\"1513838564147256.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513838564529984.jpg\" style=\"\" title=\"1513838564529984.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513838564637391.jpg\" style=\"\" title=\"1513838564637391.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513838564125258.jpg\" style=\"\" title=\"1513838564125258.jpg\"/></p><p><br/></p>','images/201712/thumb_img/225_thumb_G_1513809703374.jpg','images/201712/goods_img/225_G_1513809703191.jpg','images/201712/source_img/225_G_1513809703611.jpg',1,'',1,1,0,0,1513809703,100,0,1,1,1,0,0,1514058981,0,'',-1,-1,0,NULL),(226,242,'ECS000226','大连长白岛野生即食海参350-400g／8只','+',18,0,'',9999,0.000,160.00,99.00,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">海参<span style=\"font-size: 13px; line-height: normal;\">，</span>属海参纲<span style=\"font-size: 13px; line-height: normal;\">（Holothuroidea），</span>是生活在海边至<span style=\"font-size: 13px; line-height: normal;\">8000</span>米的海洋棘皮动物<span style=\"font-size: 13px; line-height: normal;\">，</span>距今已有六亿多年的历史<span style=\"font-size: 13px; line-height: normal;\">，</span>海参以海底藻类和浮游生物为食。<span style=\"font-size: 13px; line-height: normal;\"> </span>海参全身长满肉刺<span style=\"font-size: 13px; line-height: normal;\">，</span>广布于世界各海洋中。中国南海沿岸种类较多<span style=\"font-size: 13px; line-height: normal;\">，</span>约有二十余种海参可供食用。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">海参同人参、燕窝、鱼翅齐名<span style=\"font-size: 13px; line-height: normal;\">，</span>是世界八大珍品之一。海参不仅是珍贵的食品<span style=\"font-size: 13px; line-height: normal;\">，</span>也是名贵的药材。据《本草纲目拾遗》中记载<span style=\"font-size: 13px; line-height: normal;\">：</span>海参<span style=\"font-size: 13px; line-height: normal;\">，</span>味甘咸<span style=\"font-size: 13px; line-height: normal;\">，</span>补肾<span style=\"font-size: 13px; line-height: normal;\">，</span>益精髓<span style=\"font-size: 13px; line-height: normal;\">，</span>摄小便<span style=\"font-size: 13px; line-height: normal;\">，</span>壮阳疗痿<span style=\"font-size: 13px; line-height: normal;\">，</span>其性温补<span style=\"font-size: 13px; line-height: normal;\">，</span>足敌人参<span style=\"font-size: 13px; line-height: normal;\">，</span>故名海参。海参具有提高记忆力、延缓性腺衰老<span style=\"font-size: 13px; line-height: normal;\">，</span>防止动脉硬化以及抗肿瘤等作用。随着海参价值知识的普及<span style=\"font-size: 13px; line-height: normal;\">，</span>海参逐渐进入百姓餐桌。生活环境决定海参品质。</p><p><img src=\"/vshop/data/attached/image/20171221/1513839365241631.jpg\" style=\"\" title=\"1513839365241631.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513839365878450.jpg\" style=\"\" title=\"1513839365878450.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513839365340776.jpg\" style=\"\" title=\"1513839365340776.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513839365159324.jpg\" style=\"\" title=\"1513839365159324.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513839365187645.jpg\" style=\"\" title=\"1513839365187645.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513839365308713.jpg\" style=\"\" title=\"1513839365308713.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171221/1513839365989094.jpg\" style=\"\" title=\"1513839365989094.jpg\"/></p><p><br/></p>','images/201712/thumb_img/226_thumb_G_1513810490059.jpg','images/201712/goods_img/226_G_1513810490983.jpg','images/201712/source_img/226_G_1513810490619.jpg',1,''