&#39;;\">味酸、性温</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">营养成分<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">胡萝卜素维生素<span style=\"font-size: 13px; line-height: normal;\">C</span>木瓜蛋白酶木瓜酵素</p><p><img src=\"/vshop/data/attached/image/20171223/1513996032342508.jpg\" style=\"\" title=\"1513996032342508.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513996032707016.jpg\" style=\"\" title=\"1513996032707016.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513996032326778.jpg\" style=\"\" title=\"1513996032326778.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513996032350730.jpg\" style=\"\" title=\"1513996032350730.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513996032215063.jpg\" style=\"\" title=\"1513996032215063.jpg\"/></p><p><br/></p>','images/201712/thumb_img/227_thumb_G_1513967168836.jpg','images/201712/goods_img/227_G_1513967168502.jpg','images/201712/source_img/227_G_1513967168017.jpg',1,'',1,1,0,0,1513967168,100,0,0,0,0,0,0,1513969268,0,'',-1,-1,0,NULL),(228,244,'ECS000228','柠檬 （2个）／袋','+',6,0,'',9998,0.000,7.00,4.99,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">柠檬是芸香科柑桔属的常绿小乔木<span style=\"font-size: 13px; line-height: normal;\">，</span>原产东南亚<span style=\"font-size: 13px; line-height: normal;\">，</span>现主要产地为美国、意大利、西班牙和希腊。主要为榨汁用<span style=\"font-size: 13px; line-height: normal;\">，</span>有时也用做烹饪调料<span style=\"font-size: 13px; line-height: normal;\">，</span>但基本不用作鲜食。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">别称<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">柠果、<span style=\"font-size: 13px; line-height: normal;\"> </span>洋柠檬、<span style=\"font-size: 13px; line-height: normal;\"> </span>益母果</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">花期<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 13px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">4-5<span style=\"font-size: 14px; line-height: normal;\">月</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">功效<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">生津止渴、开胃提神、美白养肤</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">宜搭<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">鸡肉三文鱼蜂蜜</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">相克<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">山楂牛奶胡萝卜</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">性味<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">味甘酸<span style=\"font-size: 13px; line-height: normal;\">，</span>性平<span style=\"font-size: 13px; line-height: normal;\">，</span>入肝<span style=\"font-size: 13px; line-height: normal;\">，</span>胃经</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">营养成分<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">维生素<span style=\"font-size: 13px; line-height: normal;\">B1，</span>维生素<span style=\"font-size: 13px; line-height: normal;\">B2，</span>维生素<span style=\"font-size: 13px; line-height: normal;\">C</span>植物酸黄酮类</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">所属<span style=\"font-size: 13px; line-height: normal;\">:</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">被子植物门双子叶植物纲芸香目芸香科柑橘属</p><p><img src=\"/vshop/data/attached/image/20171223/1513998444906215.jpg\" style=\"\" title=\"1513998444906215.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998444630358.jpg\" style=\"\" title=\"1513998444630358.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998444770062.jpg\" style=\"\" title=\"1513998444770062.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998444881715.jpg\" style=\"\" title=\"1513998444881715.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998444243445.jpg\" style=\"\" title=\"1513998444243445.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998444971054.jpg\" style=\"\" title=\"1513998444971054.jpg\"/></p><p><br/></p>','images/201712/thumb_img/228_thumb_G_1513969520635.jpg','images/201712/goods_img/228_G_1513969520125.jpg','images/201712/source_img/228_G_1513969520405.jpg',1,'',1,1,0,0,1513969520,100,0,0,0,0,0,0,1513969727,0,'',-1,-1,0,NULL),(229,245,'ECS000229','新疆库尔勒香梨500g','+',1,0,'',10000,0.000,12.00,9.80,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">香梨<span style=\"font-size: 13px; line-height: normal;\">，</span>又称大头梨<span style=\"font-size: 13px; line-height: normal;\">，</span>是梨的一种。维吾尔语叫<span style=\"font-size: 13px; line-height: normal;\">“</span>奶西姆提<span style=\"font-size: 13px; line-height: normal;\">”</span>。其特点是香味浓郁、皮薄、肉细、汁多甜酥、清爽可口<span style=\"font-size: 13px; line-height: normal;\">，</span>系梨之上品。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">香梨以库尔勒香梨产量大<span style=\"font-size: 13px; line-height: normal;\">，</span>质量好。其种植面积达<span style=\"font-size: 13px; line-height: normal;\">2.4</span>万亩<span style=\"font-size: 13px; line-height: normal;\">，</span>年产量在千吨以上。<span style=\"font-size: 13px; line-height: normal;\"> </span>库尔勒香梨在国际市场上被誉为<span style=\"font-size: 13px; line-height: normal;\">“</span>中华蜜梨<span style=\"font-size: 13px; line-height: normal;\">”</span>、<span style=\"font-size: 13px; line-height: normal;\">“</span>梨中珍品<span style=\"font-size: 13px; line-height: normal;\">”</span>、<span style=\"font-size: 13px; line-height: normal;\">“</span>果中王子<span style=\"font-size: 13px; line-height: normal;\">”</span>等称号。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">香梨具有多种功效<span style=\"font-size: 13px; line-height: normal;\">，</span>其中包括能保护心脏<span style=\"font-size: 13px; line-height: normal;\">，</span>减轻疲劳<span style=\"font-size: 13px; line-height: normal;\">，</span>增强心肌活力<span style=\"font-size: 13px; line-height: normal;\">，</span>降低血压<span style=\"font-size: 13px; line-height: normal;\">；</span>另外<span style=\"font-size: 13px; line-height: normal;\">， </span>梨所含的配糖体及鞣酸等成分<span style=\"font-size: 13px; line-height: normal;\">，</span>能祛痰止咳。消热解暑<span style=\"font-size: 13px; line-height: normal;\">，</span>滋阴养人</p><p><img src=\"/vshop/data/attached/image/20171223/1513998796444993.jpg\" style=\"\" title=\"1513998796444993.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998796725769.jpg\" style=\"\" title=\"1513998796725769.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998796604488.jpg\" style=\"\" title=\"1513998796604488.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998796786086.jpg\" style=\"\" title=\"1513998796786086.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998796928853.jpg\" style=\"\" title=\"1513998796928853.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998796851375.jpg\" style=\"\" title=\"1513998796851375.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513998796749085.jpg\" style=\"\" title=\"1513998796749085.jpg\"/></p><p><br/></p>','images/201712/thumb_img/229_thumb_G_1513969940501.jpg','images/201712/goods_img/229_G_1513969940894.jpg','images/201712/source_img/229_G_1513969940479.jpg',1,'',1,1,0,0,1513969940,100,0,0,0,0,0,0,1513970033,0,'',-1,-1,0,NULL),(230,249,'ECS000230','美国进口蛇果／个','+',1,0,'',10000,0.000,15.00,9.99,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">蛇果<span style=\"font-size: 13px; line-height: normal;\">，</span>其实与蛇一点关系没有<span style=\"font-size: 13px; line-height: normal;\">，</span>它被音译为<span style=\"font-size: 13px; line-height: normal;\">“</span>红地厘蛇果<span style=\"font-size: 13px; line-height: normal;\">”</span>后面就演变成蛇果了<span style=\"font-size: 13px; line-height: normal;\">，</span>果实大<span style=\"font-size: 13px; line-height: normal;\">，</span>果实圆锥形<span style=\"font-size: 13px; line-height: normal;\">，</span>平均单果重<span style=\"font-size: 13px; line-height: normal;\">200g，</span>大者可达<span style=\"font-size: 13px; line-height: normal;\">500g</span>