12/goods_img/230_G_1513972958442.jpg','images/201712/source_img/230_G_1513972958378.jpg',1,'',1,1,0,0,1513970505,100,0,0,0,0,0,0,1513972958,0,'',-1,-1,0,NULL),(231,247,'ECS000231','白兰瓜1.5-2公斤／个','+',1,0,'',10000,0.000,19.00,15.80,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">白兰瓜<span style=\"font-size: 13px; line-height: normal;\">，</span>又名兰州蜜瓜<span style=\"font-size: 13px; line-height: normal;\">，</span>原名华莱士<span style=\"font-size: 13px; line-height: normal;\">，</span>原产于美国。白兰瓜一般重量为<span style=\"font-size: 13px; line-height: normal;\">1.5－2</span>公斤<span style=\"font-size: 13px; line-height: normal;\">，</span>皮厚瓜甜<span style=\"font-size: 13px; line-height: normal;\">，</span>汁丰肉嫩。在中国<span style=\"font-size: 13px; line-height: normal;\">，</span>白兰瓜是从美国引入此栽培种<span style=\"font-size: 13px; line-height: normal;\">，</span>成为兰州的特产。以兰州市城关区青白石乡的产品最为有名。为一种厚皮甜瓜<span style=\"font-size: 13px; line-height: normal;\">，</span>其形呈圆球状<span style=\"font-size: 13px; line-height: normal;\">，</span>每只重约<span style=\"font-size: 13px; line-height: normal;\">1.5</span>一<span style=\"font-size: 13px; line-height: normal;\">2.5</span>公斤。皮白且硬<span style=\"font-size: 13px; line-height: normal;\">，</span>阳面有淡黄色晕瓤呈绿色<span style=\"font-size: 13px; line-height: normal;\">，</span>内腔小<span style=\"font-size: 13px; line-height: normal;\">，</span>含糖量高达<span style=\"font-size: 13px; line-height: normal;\">13</span>一<span style=\"font-size: 13px; line-height: normal;\">16%，</span>并富含钙、磷、铁及多种维生素<span style=\"font-size: 13px; line-height: normal;\">，</span>耐贮藏<span style=\"font-size: 13px; line-height: normal;\">，</span>宜于储运。瓜肉翠绿<span style=\"font-size: 13px; line-height: normal;\">，</span>囊厚汁丰<span style=\"font-size: 13px; line-height: normal;\">，</span>脆而细嫩<span style=\"font-size: 13px; line-height: normal;\">，</span>含糖量高达<span style=\"font-size: 13px; line-height: normal;\">15%</span>左右<span style=\"font-size: 13px; line-height: normal;\">，</span>享有<span style=\"font-size: 13px; line-height: normal;\">“</span>香如桂花<span style=\"font-size: 13px; line-height: normal;\">，</span>甜似蜂蜜<span style=\"font-size: 13px; line-height: normal;\">“</span>之誉</p><p><img src=\"/vshop/data/attached/image/20171223/1513999832795740.jpg\" style=\"\" title=\"1513999832795740.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513999832666493.jpg\" style=\"\" title=\"1513999832666493.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513999832707868.jpg\" style=\"\" title=\"1513999832707868.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513999832452317.jpg\" style=\"\" title=\"1513999832452317.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513999832449384.jpg\" style=\"\" title=\"1513999832449384.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1513999832586899.jpg\" style=\"\" title=\"1513999832586899.jpg\"/></p><p><br/></p>','images/201712/thumb_img/231_thumb_G_1513970977767.jpg','images/201712/goods_img/231_G_1513970977477.jpg','images/201712/source_img/231_G_1513970977037.jpg',1,'',1,1,0,0,1513970977,100,0,0,0,0,0,0,1513971062,0,'',-1,-1,0,NULL),(232,248,'ECS000232','新疆阿克苏苹果500g','+',2,0,'',10000,0.000,10.00,8.80,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">阿克苏苹果是苹果的一种<span style=\"font-size: 13px; line-height: normal;\">，</span>具有果面光滑细腻、色泽光亮、果肉细腻、果核透明等特点。果香浓郁、甘甜味厚、汁多无渣<span style=\"font-size: 13px; line-height: normal;\">，</span>冰糖心含量高达<span style=\"font-size: 13px; line-height: normal;\">70%</span>以上。阿克苏苹果富含丰富的维生素<span style=\"font-size: 13px; line-height: normal;\">C</span>、纤维素、果胶</p><p><img src=\"/vshop/data/attached/image/20171223/1514000233289415.jpg\" style=\"\" title=\"1514000233289415.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1514000233613993.jpg\" style=\"\" title=\"1514000233613993.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1514000233216121.jpg\" style=\"\" title=\"1514000233216121.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1514000233404669.jpg\" style=\"\" title=\"1514000233404669.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1514000233183957.jpg\" style=\"\" title=\"1514000233183957.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171223/1514000233965462.jpg\" style=\"\" title=\"1514000233965462.jpg\"/></p><p><br/></p>','images/201712/thumb_img/232_thumb_G_1513971323331.jpg','images/201712/goods_img/232_G_1513971323300.jpg','images/201712/source_img/232_G_1513971323278.jpg',1,'',1,1,0,0,1513971323,100,0,0,0,0,0,0,1513971465,0,'',-1,-1,0,NULL),(233,251,'ECS000233','碧根果 500g','+',1,0,'',10000,0.000,35.00,32.80,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">碧根果<span style=\"font-size: 13px; line-height: normal;\">(Carya illinoensis ( Wangh． ) Koch)[1]</span>是美国山核桃的果实<span style=\"font-size: 13px; line-height: normal;\">，</span>原产于美国和墨西哥北部<span style=\"font-size: 13px; line-height: normal;\">，</span>是世界十大坚果之一<span style=\"font-size: 13px; line-height: normal;\">，</span>又名薄壳山核桃<span style=\"font-size: 13px; line-height: normal;\">[2]</span>、<span style=\"font-size: 13px; line-height: normal;\">“</span>长寿果<span style=\"font-size: 13px; line-height: normal;\">”</span>、<span style=\"font-size: 13px; line-height: normal;\">“</span>美国山核桃<span style=\"font-size: 13px; line-height: normal;\">”</span>、<span style=\"font-size: 13px; line-height: normal;\">“</span>长山核桃<span style=\"font-size: 13px; line-height: normal;\">”</span>。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">碧根果含有丰富的脂肪、糖类、蛋白质、多种维生素和矿物质<span style=\"font-size: 13px; line-height: normal;\">[3]</span>。食用后能补肾健脑、补中益气<span style=\"font-size: 13px; line-height: normal;\">，</span>润肌肤、乌须发。壳很脆<span style=\"font-size: 13px; line-height: normal;\">，</span>跟香榧一样脆<span style=\"font-size: 13px; line-height: normal;\">，</span>易剥。肉质介于大核桃与小核桃之间<span style=\"font-size: 13px; line-height: normal;\">，</span>碧根果是全世界<span style=\"font-size: 13px; line-height: normal;\">17</span>种核桃之一。</p><p><img src=\"/vshop/data/attached/image/20171228/1514426606888376.jpg\" style=\"\" title=\"1514426606888376.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514426606575180.jpg\" style=\"\" title=\"1514426606575180.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514426607296149.jpg\" style=\"\" title=\"1514426607296149.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514426607847642.jpg\" style=\"\" title=\"1514426607847642.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514426607236598.jpg\" style=\"\" title=\"1514426607236598.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514426608624220.jpg\" style=\"\" title=\"1514426608624220.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514426608776866.jpg\" style=\"\" title=\"1514426608776866.jpg\"/></p><p><br/></p>','images/201712/thumb_img/233_thumb_G_1514397944135.jpg','images/201712/goods_img/233_G_1514397944300.jpg','images/201712/source_img/233_G_1514397944633.jpg',1,'',1,1,0,0,1514397703,100,0,0,0,0,0,0,1514397944,0,'',-1,-1,0,NULL),(234,252,'ECS000234','开口松子 500g','+',1,0,'',10000,0.000,46.00,43.98,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">松子又名松实、果松子、海松子<span style=\"font-size: 13px; line-height: normal;\">，</span>是松科植物红松等的种子<span style=\"font-size: 13px; line-height: normal;\">，</span>是常见的坚果之一。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">营养价值</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">富含脂肪、蛋白质、碳水化合物等。是重要的中药<span style=\"font-size: 13px; line-height: normal;\">，</span>久食健身心<span style=\"font-size: 13px; line-height: normal;\">，</span>滋润皮肤<span style=\"font-size: 13px; line-height: normal;\">，</span>延年益寿<span style=\"font-size: 13px; line-height: normal;\">，</span>也有很高的食疗价值每百克松子仁中含蛋白质<span style=\"font-size: 13px; line-height: normal;\">16.7</span>克<span style=\"font-size: 13px; line-height: normal;\">，</span>碳水化合物<span style=\"font-size: 13px; line-height: normal;\">9.8</span>克<span style=\"font-size: 13px; line-height: normal;\">，</span>脂肪<span style=\"font-size: 13px; line-height: normal;\">63.5</span>克。松子的脂肪大部分为油酸、亚油酸等不饱和脂肪酸组成。还含有钙<span style=\"font-size: 13px; line-height: normal;\">78</span>毫克、磷<span style=\"font-size: 13px; line-height: normal;\">236</span>毫克、铁<span style=\"font-size: 13px; line-height: normal;\">6.7</span>毫克等成分。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">功效<span style=\"font-size: 13px; line-height: normal;\">：</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">松子性温味甘。具有养阴、熄风、润肺、滑肠等功效。治风痹、头眩、燥咳、吐血、便秘等病。《日华子本草》载<span style=\"font-size: 13px; line-height: normal;\">“</span>逐风痹寒气<span style=\"font-size: 13px; line-height: normal;\">，</span>虚羸少气<span style=\"font-size: 13px; line-height: normal;\">，</span>补不足<span style=\"font-size: 13px; line-height: normal;\">，</span>润皮肤<span style=\"font-size: 13px; line-height: normal;\">，</span>肥五脏。<span style=\"font-size: 13px; line-height: normal;\">”</span>《玉楸药解》载<span style=\"font-size: 13px; line-height: normal;\">“</span>润肺止咳<span style=\"font-size: 13px; line-height: normal;\">，</span>滑肠通便<span style=\"font-size: 13px; line-height: normal;\">，</span>开关逐痹<span style=\"font-size: 13px; line-height: normal;\">，</span>泽肤荣毛。</p><p><img src=\"/vshop/data/attached/image/20171228/1514429748673607.jpg\" style=\"\" title=\"1514429748673607.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514429748703592.jpg\" style=\"\" title=\"1514429748703592.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514429748367381.jpg\" style=\"\" title=\"1514429748367381.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514429749449782.jpg\" style=\"\" title=\"1514429749449782.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514429749809462.jpg\" style=\"\" title=\"1514429749809462.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514429749801677.jpg\" style=\"\" title=\"1514429749801677.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514429749282676.jpg\" style=\"\" title=\"1514429749282676.jpg\"/></p><p><br/></p>','images/201712/thumb_img/234_thumb_G_1514400847271.jpg','images/201712/goods_img/234_G_1514400847982.jpg','images/201712/source_img/234_G_1514400847867.jpg',1,'',1,1,0,0,1514400847,100,0,0,0,0,0,0,1514401169,0,'',-1,-1,0,NULL),(235,253,'ECS000235','原味毛克 500g','+',1,0,'',10000,0.000,15.00,11.98,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">毛嗑其实就是<span style=\"font-size: 13px; line-height: normal;\">“</span>葵花籽<span style=\"font-size: 13px; line-height: normal;\">”，</span>向日葵<span style=\"font-size: 13px; line-height: normal;\">，</span>喜阳<span style=\"font-size: 13px; line-height: normal;\">，</span>长大后呈圆盘状。东北大部分地区方言都称<span style=\"font-size: 13px; line-height: normal;\">“</span>葵花籽<span style=\"font-size: 13px; line-height: normal;\">”</span>叫<span style=\"font-size: 13px; line-height: normal;\">“</span>毛嗑<span style=\"font-size: 13px; line-height: normal;\">”</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">毛克营养丰富<span style=\"font-size: 13px; line-height: normal;\">，</span>香气诱人<span style=\"font-size: 13px; line-height: normal;\">，</span>西瓜子能健胃、利肺、润肠<span style=\"font-size: 13px; line-height: normal;\">；</span>葵花子脂肪酸及维生素<span style=\"font-size: 13px; line-height: normal;\">E</span>含量丰富<span style=\"font-size: 13px; line-height: normal;\">；</span>南瓜子有驱虫作用<span style=\"font-size: 13px; line-height: normal;\">，</span>适当嗑点瓜子<span style=\"font-size: 13px; line-height: normal;\">，</span>能刺激舌头上的味觉神经<span style=\"font-size: 13px; line-height: normal;\">，</span>促进唾液、胃液的分泌<span style=\"font-size: 13px; line-height: normal;\">，</span>有利消化<span style=\"font-size: 13px; line-height: normal;\">，</span>有益健康<span style=\"font-size: 13px; line-height: normal;\">，</span>还能促进面部肌肉的运动。据报道<span style=\"font-size: 13px; line-height: normal;\">，</span>葵花子有医疗价值<span style=\"font-size: 13px; line-height: normal;\">，</span>可治泻痢、脓疱疮等疾病</p><p><img src=\"/vshop/data/attached/image/20171228/1514431139664761.jpg\" style=\"\" title=\"1514431139664761.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514431139595081.jpg\" style=\"\" title=\"1514431139595081.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514431139779480.jpg\" style=\"\" title=\"1514431139779480.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514431139271263.jpg\" style=\"\" title=\"1514431139271263.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514431139427481.jpg\" style=\"\" title=\"1514431139427481.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514431139160524.jpg\" style=\"\" title=\"1514431139160524.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514431139980048.jpg\" style=\"\" title=\"1514431139980048.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514431139155292.jpg\" style=\"\" title=\"1514431139155292.jpg\"/></p><p><br/></p>','images/201712/thumb_img/235_thumb_G_1514402207371.jpg','images/201712/goods_img/235_G_1514402207132.jpg','images/201712/source_img/235_G_1514402207492.jpg',1,'',1,1,0,0,1514402207,100,0,0,0,0,0,0,1514402521,0,'',-1,-1,0,NULL),(236,254,'ECS000236','蒜香花生 500g','+',2,0,'',10000,0.000,9.00,7.85,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">花生的蛋白质含量为<span style=\"font-size: 13px; line-height: normal;\">25%--30%，</span>花生蛋白含有人体必需的八种氨基酸<span style=\"font-size: 13px; line-height: normal;\">，</span>精氨酸含量高于其它坚果<span style=\"font-size: 13px; line-height: normal;\">，</span>生物学效价高于大豆。每日食用一定量的花生、花生油或花生制品<span style=\"font-size: 13px; line-height: normal;\">，</span>不仅能提供大量蛋白、脂肪和能量而且可降低膳食饱和脂肪和增加不饱和脂肪酸的摄入<span style=\"font-size: 13px; line-height: normal;\">，</span>大大促进植物蛋白质、膳食纤维、维生素<span style=\"font-size: 13px; line-height: normal;\">E</span>、叶酸、钾、镁、锌、钙等这些对健康有益的营养素的摄入。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 13px; line-height: normal; font-family: &#39;Helvetica Neue&#39;; min-height: 15px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">花生本身是高能、高蛋白和高脂类的植物性食物<span style=\"font-size: 13px; line-height: normal;\">，</span>不含胆固醇和反式脂肪酸<span style=\"font-size: 13px; line-height: normal;\">，</span>而且富含微量营养素<span style=\"font-size: 13px; line-height: normal;\">，</span>植物固醇、白藜芦醇、异黄酮、抗氧化剂等物质<span style=\"font-size: 13px; line-height: normal;\">，</span>有重要的保健作用<span style=\"font-size: 13px; line-height: normal;\">，</span>更是乳、肉食物的优秀替代品<span style=\"font-size: 13px; line-height: normal;\">，</span>对平衡膳食、改善中国居民的营养与健康状况具有重要作用。</p><p><img src=\"/vshop/data/attached/image/20171228/1514432286836108.jpg\" style=\"\" title=\"1514432286836108.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432286220370.jpg\" style=\"\" title=\"1514432286220370.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432286613648.jpg\" style=\"\" title=\"1514432286613648.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432286561528.jpg\" style=\"\" title=\"1514432286561528.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432286318812.jpg\" style=\"\" title=\"1514432286318812.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432286952914.jpg\" style=\"\" title=\"1514432286952914.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432286959046.jpg\" style=\"\" title=\"1514432286959046.jpg\"/></p><p><br/></p>','images/201712/thumb_img/236_thumb_G_1514403297721.jpg','images/201712/goods_img/236_G_1514403297008.jpg','images/201712/source_img/236_G_1514403297726.jpg',1,'',1,1,0,0,1514403297,100,0,0,0,0,0,0,1514403492,0,'',-1,-1,0,NULL),(237,255,'ECS000237','山楂卷 500g（福君山）','+',4,0,'',9999,0.000,7.00,6.48,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">山楂具有降血脂、血压、强心、抗心律不齐等作用<span style=\"font-size: 13px; line-height: normal;\">，</span>同时也是健脾开胃、消食化滞、活血化痰的良药<span style=\"font-size: 13px; line-height: normal;\">，</span>对胸膈脾满、疝气、血淤、闭经等症有很好的疗效。山楂内的黄酮类化合物牡荆素<span style=\"font-size: 13px; line-height: normal;\">，</span>是一种抗癌作用较强的药物<span style=\"font-size: 13px; line-height: normal;\">，</span>其提取物对抑制体内癌细胞生长、增殖和浸润转移均有一定的作用</p><p><img src=\"/vshop/data/attached/image/20171228/1514432823323099.jpg\" style=\"\" title=\"1514432823323099.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432823129031.jpg\" style=\"\" title=\"1514432823129031.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432823742678.jpg\" style=\"\" title=\"1514432823742678.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432823839869.jpg\" style=\"\" title=\"1514432823839869.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20171228/1514432823199322.jpg\" style=\"\" title=\"1514432823199322.jpg\"/></p><p><br/></p>','images/201712/thumb_img/237_thumb_G_1514403795359.jpg','images/201712/goods_img/237_G_1514403795055.jpg','images/201712/source_img/237_G_1514403795989.jpg',1,'',1,1,0,0,1514403795,100,0,0,0,0,0,0,1514404052,0,'',-1,-1,0,NULL),(238,256,'ECS000238','泰国进口山竹（5A） 500g','+',16,0,'',10000,0.000,45.00,37.98,0.00,0,0,1,'','','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">山竹<span style=\"font-size: 13px; line-height: normal;\">（</span>学名<span style=\"font-size: 13px; line-height: normal;\">：Garcinia mangostana），</span>又名莽吉柿、山竺、山竹子、倒捻子、凤果<span style=\"font-size: 13px; line-height: normal;\">，</span>既可以指植物山竹<span style=\"font-size: 13px; line-height: normal;\">，</span>为金丝桃科藤黄属下的一个种<span style=\"font-size: 13px; line-height: normal;\">，</span>也可以指这种植物的果实山竹。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">山竹原名莽吉柿<span style=\"font-size: 13px; line-height: normal;\">，</span>原产于东南亚<span style=\"font-size: 13px; line-height: normal;\">，</span>一般种植<span style=\"font-size: 13px; line-height: normal;\">10</span>年才开始结果<span style=\"font-size: 13px; line-height: normal;\">，</span>对环境要求非常严格<span style=\"font-size: 13px; line-height: normal;\">，</span>因此是名副其实的绿色水果<span style=\"font-size: 13px; line-height: normal;\">，</span>与榴莲齐名<span style=\"font-size: 13px; line-height: normal;\">，</span>号称<span style=\"font-size: 13px; line-height: normal;\">“</span>果中皇后<span style=\"font-size: 13px; line-height: normal;\">”</span></p><p>营养价值&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">性平<span style=\"font-size: 13px; line-height: normal;\">，</span>味甘、微酸。皮<span style=\"font-size: 13px; line-height: normal;\">：</span>性凉<span style=\"font-size: 13px; line-height: normal;\">，</span>味苦、涩。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">健脾生津<span style=\"font-size: 13px; line-height: normal;\">，</span>止泻。皮<span style=\"font-size: 13px; line-height: normal;\">：</span>消炎止痛。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">主治脾虚腹泻<span style=\"font-size: 13px; line-height: normal;\">，</span>口干<span style=\"font-size: 13px; line-height: normal;\">，</span>烧伤<span style=\"font-size: 13px; line-height: normal;\">，</span>烫伤<span style=\"font-size: 13px; line-height: normal;\">，</span>湿疹<span style=\"font-size: 13px; line-height: normal;\">，</span>口腔炎</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">山竹果肉含可溶性固形物<span style=\"font-size: 13px; line-height: normal;\">16.8%，</span>柠檬酸<span style=\"font-size: 13px; line-height: normal;\">0.63%，</span>还含有其它维生素<span style=\"font-size: 13px; line-height: normal;\">B1，B2，C4</span>和矿物质<span style=\"font-size: 13px; line-height: normal;\">，</span>具有降燥、清凉解热的作用<span style=\"font-size: 13px; line-height: normal;\">，</span>因此<span style=\"font-size: 13px; line-height: normal;\">，</span>山竹不仅味美<span style=\"font-size: 13px; line-height: normal;\">，</span>而且还有降火的功效<span style=\"font-size: 13px; line-height: normal;\">，</span>能克榴莲之燥热。在泰国<span style=\"font-size: 13px; line-height: normal;\">，</span>人们将榴莲山竹视<span style=\"font-size: 13px; line-height: normal;\">“</span>夫妻果<span style=\"font-size: 13px; line-height: normal;\">”</span>。如果吃了过多榴莲上了火<span style=\"font-size: 13px; line-height: normal;\">，</span>吃上几个山竹就能缓解。</p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\">另外<span style=\"font-size: 13px; line-height: normal;\">，</span>山竹含有丰富的蛋白质和脂类<span style=\"font-size: 13px; line-height: normal;\">，</span>对机体有很好的补养作用<span style=\"font-size: 13px; line-height: normal;\">，</span>对体弱、营养不良、病后都有很好的调养作用。</p><p><img src=\"/vshop/data/attached/image/20180103/1514972100606222.jpg\" style=\"\" title=\"1514972100606222.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180103/1514972100645858.jpg\" style=\"\" title=\"1514972100645858.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180103/1514972100733939.jpg\" style=\"\" title=\"1514972100733939.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180103/1514972100800379.jpg\" style=\"\" title=\"1514972100800379.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180103/1514972100841001.jpg\" style=\"\" title=\"1514972100841001.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180103/1514972100194646.jpg\" style=\"\" title=\"1514972100194646.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180103/1514972101191291.jpg\" style=\"\" title=\"1514972101191291.jpg\"/></p><p><img src=\"/vshop/data/attached/image/20180103/1514972101573112.jpg\" style=\"\" title=\"1514972101573112.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 14px; line-height: normal; font-family: &#39;Helvetica Neue&#39;;\"><br/></p>','images/201801/thumb_img/238_thumb_G_1514943161314.jpg','images/201801/goods_img/238_G_1514943161983.jpg','images/201801/source_img/238_G_1514943161532.jpg',1,'',1,1,0,0,1514943160,100,0,1,1,1,0,0,1514943479,0,'',-1,-1,0,NULL);
