INSERT INTO `ws_ww_article` VALUES ('08BF9DB5-A31E-4C66-8545-91DE25571D68','n20160128008','p20160129005','新闻咨询','','0000-00-00 00:00:00','/upload/1454059819_)[A((O}6]CF86E{@3INXND7.png','',0,'admin','2016-01-29','',0),('1','n20160119002','n20160119001','女子为换身份证照拍32次：眼小嫌丑 眼大嫌凶','<h1 style=\"text-align:left;background-color:#ffffff;color:#252525;\" class=\"otitle\">\r\n	<span style=\"font-size:12px;font-weight:normal;line-height:1.5;\">(原标题：眼小嫌丑眼大嫌凶 女子为换身份证照拍32次）</span> \r\n</h1>\r\n<div style=\"text-align:justify;background-color:#ffffff;margin:0px 10px 0px 0px;color:#252525;\" id=\"endText\" class=\"end-text\">\r\n	<div style=\"margin:0px auto;font-size:14px;\" id=\"tupian_div\" align=\"center\">\r\n	</div>\r\n	<p style=\"text-indent:2em;font-size:16px;\">\r\n		中新网南京1月19日电 “不PS都不好意思发照片了”是当下流行的一句戏言，但毕竟生活中不是所有的照片都能PS。19日，江苏常州兰陵派出所公布了该所近期发生的一件奇事：一位女士为了一张满意的身份证照片，先后让工作人员拍摄了32次，才终于勉强“过关”。\r\n	</p>\r\n	<p style=\"text-indent:2em;font-size:16px;\">\r\n		1月15日，常州市民孙小姐来到兰陵派出所进行身份证的更换。图像采集前，孙小姐来到照相室对着镜子补妆，并做出各种表情来放松肌肉。第一张照片拍完后，孙小姐认为自己眼睛太小，要求重拍。而重拍的第二张照片，孙小姐觉得自己眼睛瞪得太大，显得太凶，仍不满意。经过多次重拍后，孙小姐觉得其中一张还可以。于是派出所工作人员在征得其同意后便上传了该照片。\r\n	</p>\r\n	<p style=\"text-indent:2em;font-size:16px;\">\r\n		不曾想过了一会后，“回过味来”的孙小姐又说照片不好看，希望换掉。百般要求下，派出所工作人员只得打电话联系分局将上传的照片又撤换掉。就这样，前前后后拍摄了32次后，孙小姐表示还是那张被替下来的最合适。最后，哭笑不得的工作人员还是用了该照片作为身份证照。\r\n	</p>\r\n</div>','2016-01-06 09:16:52','/upload/1454059232_)[A((O}6]CF86E{@3INXND7.png','',3,'admin','2016-01-29','w1233333333333333333333\r\n21333333333333333\r\n132222222222222\r\n1322222222222222222222ewq cqwewrqfecesdsadf sada\r\n13222222222222222addssads2das',0),('1B24387C-833A-4BE0-A201-71E88F4DFE6F','n20160128011','p20160130004','1','','0000-00-00 00:00:00','','',2,'admin','2016-01-30','',0),('3A36E92D-CBEA-4A14-8C42-7BA0215988A3','n20160128002','p20160129004','术豪美业新年特惠套装','','2016-01-29 17:29:00','/upload/1454059795_)[A((O}6]CF86E{@3INXND7.png','',0,'admin','2016-01-29','',0),('3EABB58D-023B-4847-9F17-F6DBD13CFB6A','n20160128011','p20160129003','发现吗','','2016-01-29 14:55:00','/upload/1454050530_)[A((O}6]CF86E{@3INXND7.png','',0,'admin','2016-01-29','',0),('43E58D17-2C3D-471F-B6DE-2C56CE51E2F1','n20160128011','p20160130009','1','2','1970-01-01 00:00:00','','',3,'admin','2016-01-30','2',0),('502D4289-EAE4-4B37-B394-8BD9CF476628','n20160130002','p20160130005','分享','','1970-01-01 00:00:00','','',0,'admin','2016-01-30','',0),('5E0A8FCB-3B86-4A35-8C39-997A49592992','n20160128011','p20160130111','3','2','2016-01-30 14:59:00','','',3,'admin','2016-01-30','2',0),('6FF20364-2DD3-4363-9004-6ABE48925AFE','n20160128011','p20160130002','QQ群','','0000-00-00 00:00:00','','',0,'admin','2016-01-30','',0),('7EDFEBBB-6905-4D29-BAC2-DE1D7485D2C0','n20160128011','p20160130222','1','1','1970-01-01 00:00:00','','',2,'admin','2016-01-30','2',0),('9C90E5A7-B174-4270-93FB-08F909E8D04E','n20160130005','p20160130007','领券','','0000-00-00 00:00:00','','',0,'admin','2016-01-30','',0),('A44228A0-E0CC-4103-BB3C-82B8C8024EAA','n20160128011','p20160130001','订单','','0000-00-00 00:00:00','','',0,'admin','2016-01-30','',0),('A48F2318-BAEC-4979-A0CB-7B9D6717B60E','n20160130007','p20160130006','签到','','0000-00-00 00:00:00','','',0,'admin','2016-01-30','',0),('A7E15AF5-CD23-4565-B23B-B8420236D3FD','n20160128011','p20160130003','1','111','2016-01-30 14:57:00','','',1,'admin','2016-01-30','',0),('B6606807-228F-4C89-BCF0-16372C7C3CFD','n20160128011','p20160130121','2','','1970-01-01 00:00:00','','',3,'admin','2016-01-30','',0),('E8D00179-BD75-4140-BF3D-C75D0EEB06EF','n20160130009','p20160130008','预约','<img src=\"/weishop/kindeditor/attached/image/20160130/20160130075319_22590.jpg\" alt=\"\" />','1970-01-01 00:00:00','/upload/1454140411_预约.jpg','',0,'admin','2016-01-30','',0);
